import logo from './logo.svg';
import './App.css';
import {Route,Routes,Link} from 'react-router-dom';
import Category from './Admin/Category';
import DisplayAllCategory from './Admin/DisplayAllCategory';
import Dashboard from './Admin/Dashboard';
import Product from './Admin/Product'


function App(props) {
  return (
    <div className="App">
     <Routes>
     <Route strict props={props.history} component= {Category} path="/category"/>
     <Route strict props={props.history} component= {DisplayAllCategory} path="/displayallcategory"/>
     <Route strict props={props.history} component= {Dashboard} path="/dashboard"/>

      </Routes>
    </div>
  );
}

export default App;
